package com.mits;

public class PrintNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=100;i++) {
			System.out.println(i);}
		int i=0;
		while(i<5) {
			System.out.println(i);
			i=i+1;
		}
		int j=0;
		do
		{
			System.out.println(j);
			j=j+1;
			
		}while(j<5);

	}

}
